                    // $('<li/>').text(msg.content).
                    //     prepend( $('<small />').text(msgTime.getHours() + ':' + msgTime.getMinutes() + ':' + msgTime.getSeconds() + ' ' + msg.name) ).
                    //     appendTo('ul#messages');
                    $('ul#messages').data('last_message_id', msg.id);
                }
            }
            
            // Remove all but the last 50 messages in the list to prevent browser slowdown with extremely large lists
            // and finally scroll down to the newes message.
            var myvar=<?php echo $_SESSION['bfmsg']; ?>;
            $('ul#messages > li').slice(0, -myvar).remove();
            //$('ul#messages').scrollTop( $('ul#messages').get(0).scrollHeight ); /* Commented this line: to prevent interruption reading previous msg. */
            
        }});
    };
    
    // Kick of the poll function and repeat it every two seconds
    poll_for_new_messages();
    window.setInterval(poll_for_new_messages, 2000);

    /* update ago time every minute */
    window.setInterval(function(){
        $('time').each(function(i, e) {
            let oldTime = $(e).data('old');
            let moment = getConvertedTime(oldTime).fromNow();
            $(e).text(moment);
        });
    }, 60000);

    window.setTimeout(function() {
        $(".alert").fadeTo(500, 0).slideUp(500, function(){
            $(this).remove();
        });
    }, 4000);

    /* convert php-time to js-time */
    var getConvertedTime = function(phptime){
        let phptojstime = new Date(phptime * 1000);
        let dhakaTime = moment(phptojstime).tz('Asia/Dhaka'); /* Set timezone */
        return dhakaTime;
    }

    /* Active user list */
    var getLoggedinUsers = {
        data:"",
        list:"",
        fire: function () {
            $.ajax({
                url: "./ajax.reader.php",
                async: false,
                data: {"get": "activeUsers"},
                success: function (data){
                    getLoggedinUsers.data = data;
                },
                error: function(xhr, status, error) {
                    getLoggedinUsers.data = error;
                }
            });
        },
        show: function () {
            if(getLoggedinUsers.data){
                var contents = "";
                $.each(JSON.parse(getLoggedinUsers.data), function(key, user){   
                    var time = "";
                    if(user.time){                        
                        let thisTime = getConvertedTime(user.time);
                        // time = " (" + thisTime.getHours() + ':' + thisTime.getMinutes() + ')';
                        // time = moment(thisTime).fromNow();
                        time = thisTime.format(" (hh:mm A)");
                    }
                    contents += "" + user.name + time + ", ";
                });
                getLoggedinUsers.list = contents;
            }            
        }
    };
    function show_loggedin_users(){
        getLoggedinUsers.fire();
        getLoggedinUsers.show();
        // console.log(getLoggedinUsers.list);
        $('#activeUserList').html( getLoggedinUsers.list );
    }
    show_loggedin_users();
    window.setInterval(function(){        
        show_loggedin_users();        
    }, 120000); /* fetch active user every 2 minutes */

    $("#content").keypress(function (e) {
        if(e.which == 13 && !e.shiftKey) {
            $(this).closest("form").submit();
            $('#content').val('');
            $("#refresh").load(location.href + " #refresh");
            e.preventDefault();
            return false;
        }
    });

    /* Jump to Last msg funtionality */
    var jump_to_button = $('#jump-to-last');
    $("#messages").scroll(function() { 
        var msgwind_height = $(this).height();
        var msg_position = ($(this).get(0).scrollHeight - $(this).scrollTop()); /* Arbitrary calculation */
        var scroll_distance = (msg_position - msgwind_height);
        var lastmsg_height = $(this).find('li:last-child').height();
        if (scroll_distance >= lastmsg_height) {
            jump_to_button.fadeIn(200);    // Fade in the arrow
        } else {
            jump_to_button.fadeOut(200);   // Else fade out the arrow
        }
    });
    jump_to_button.click(function() {      // When arrow is clicked
        $('#messages').animate({
            scrollTop : $("#messages").get(0).scrollHeight       // Scroll to last msg
        }, 500);
    });

    /* page refresh every 30 mins */
    setTimeout(function() 
	{
		window.location = "./main.php"
	}, 1800000);

<?php
}
